window.bookSummaryJSON = "<p><b>Prepare for the heart-warming culmination of Eva and Bhathian's story!</b></p> <p>While Eva and her crew welcome Bhathian into their home, he proceeds with caution, making an effort to win everyone over and solidify his relationship with Eva.</p> <p>Robert and Carol suffer the results of their breakup. Both are lonely, but while Robert has no shortage of willing partners, Carol is too busy training and running the coffee shop to search for her pleasure elsewhere.</p> <p>Tessa and Jackson's feelings for each other intensify. Impatient to become immortal, she pushes to move forward before she is ready.</p>"; 
